Now I‚Äôm going to go ahead and participate in the #CreativeRootsChallenge since I feel that pattern testing is a definitely something that has changed my maker journey.

1. I have been crocheting for over 20 years now but in the last year or so, everything changed for me when I started pattern testing (thank you @leroocrochet for taking a chance on me ü•∞) I got to meet a whole group of people that I probably never would have otherwise and it‚Äôs been great. Wonderful friendships have come from testing and I can‚Äôt get enough.

2. I designed my first pattern! This is something I never thought I would be capable of but thanks to the love and support of my friends, I took the leap and I‚Äôm so proud of myself for it.

3. I started crocheting because my mom crocheted. She taught me when I was in elementary school and now that I crochet all the time, I appreciate it even more. I also found out that my great-grandmother (that I didn‚Äôt know) crocheted and that makes me feel so connected to my past, it‚Äôs crazy. I love knowing that I have something in common with a relative that I didn‚Äôt know, it makes me love her so much and appreciate everything she made (which was a lot, she was a very prolific crocheter)
‚Ä¢
If you made it this far, are you participating in this challenge? If you are let me know, I would love to learn more about you!
